rule.condition:
(action, {
    getState
  }) => {
    const state = getState();
    const {
      hits,
      filters
    } = state.users;
    const {
      gender,
      numHits
    } = action.payload;
    if (!hits) return false;
    if (filters.gender !== gender) return false;
    if (filters.numHits !== numHits) return false;
    return true;
  }

